class Textract
  def self.parse_s3_files
    ## load AWS credentials and instantiate an AWS Textract client
    credentials = Aws::Credentials.new(Rails.application.credentials.aws.access_key_id, Rails.application.credentials.aws.secret_access_key)
    client = Aws::Textract::Client.new(credentials: credentials, region: 'us-west-2')

    ## this is the aws S3 bucket where statement pdfs are stored
    bucket = "kenyan-dev"

    ## get the path within the s3 bucket for the statement pdf
    s3_path = "17_12_2021_Nation_MyNetWork_pg9.jpg"

    ## request to aws textract service to begin parsing the document specified by s3_path
    ## note: if parsing was initiated on this statement already then response will contain the details
    ## of the earlier run and will not initiate a new parsing job for this statement
    response = client.start_document_analysis({
      document_location: {
        s3_object: {
          bucket: bucket,
          name: s3_path
        }
      },
      feature_types: ["FORMS"],
      client_request_token: "17_12_2021_Nation_MyNetWork_pg9_2",
      })

    Rails.logger.info("Parse job id: #{response.job_id}")

    ## this call retrieves the status of the parsing job and stores it in
    ## the analysis variable.
    analysis = client.get_document_analysis({
      job_id: response.job_id
    })
  end
end

